;; **
;;; This function transforms expressions in our biased grammar into canonical algebolic expressions.
;; **

;; @@
(defn grammar-replace
  [expr]
  (walk/postwalk-replace
    {'sin-theta '[:sin theta]
     'cos-theta '[:cos theta]
     'sin-omega '[:sin omega]
     'cos-omega '[:cos omega]
     'theta-sq '[:times theta theta]
     'omega-sq '[:times omega omega]
     'theta-cube '[:times [:times theta theta] theta]
     'omega-cube '[:times [:times omega omega] omega]
     'theta-four '[:times [:times theta theta] [:times theta theta]]
     'omega-four '[:times [:times omega omega] [:times omega omega]]
     'sin-theta2 '[:sin theta2]
     'cos-theta2 '[:cos theta2]
     'sin-omega2 '[:sin omega2]
     'cos-omega2 '[:cos omega2]
     'theta2-sq '[:times theta2 theta2]
     'omega2-sq '[:times omega2 omega2]
     'theta2-cube '[:times [:times theta2 theta2] theta2]
     'omega2-cube '[:times [:times omega2 omega2] omega2]
     'theta2-four '[:times [:times theta2 theta2] [:times theta2 theta2]]
     'omega2-four '[:times [:times omega2 omega2] [:times omega2 omega2]]
     } expr))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;flow.runs.pendulum/grammar-replace</span>","value":"#'flow.runs.pendulum/grammar-replace"}
;; <=

;; @@
(grammar-replace (genetics/random-full-tree functions terminals 3))
(count vars)
(count ['theta 'theta2])
['theta 'theta2]
